                        <html><head><meta charset="utf-8"></head><body>
<p>Стерилизованный при температуре свыше 1200 С песок RIO является прекрасным средством для поддержания чистоты и свежести в клетке. Дополнительный гигиенический эффект придает экстракт эвкалипта, который благодаря своим целебным свойствам оказывает противовоспалительное, противомикробное, дезинфицирующее действие. Эффективен для профилактики развития бактерий и паразитов на теле птиц: клещей, пухо- и пероедов. Нейтрализует неприятные запахи.<br />Белый цвет песка способствует сохранению естественного окраса птицы. Вкрапления ракушечника являются источником кальция и других минеральных веществ.</p>
<p><strong>Ингредиенты:</strong></p>
<p>- Мелкий белый кварцевый песок<br />- Ракушечник<br />- Концентрированное масло эвкалипта</p>
<p><strong>Рекомендации по применению:</strong> насыпайте на дно клетки слоем толщиной 1 см. Меняйте по мере загрязнения 1-2 раза в неделю.</p>
</body></html>

